import React from 'react';
import Logo from './assets/img/polymapp_logo.svg'

function App() {
  return (
    <div style={{backgroundColor: "blue"}}>
      <img src={Logo} className="App-logo" alt="logo" />
    </div>
  );
}

export default App;
